import React from 'react'

const BreakfastRecipe = (props) =>{
    console.log('props in Breakfast Recipe list ->', props)
    console.log("[0] :", props.breakfastRecipe[0])
    const recipeList = props.breakfastRecipe.map((recipe) =>{

        return (
            <div key={recipe.id}>

                <h1>{recipe.title}</h1>
                <img src={recipe.image} alt={recipe.title}/>
            </div>
        )
    })
    const ingredientList = props.breakfastIngredients.map((ingredient) => {
        return(
            <li key={ingredient.id}>{ingredient.original}</li>
        )
    })
    const instructions = props.breakfastInstructions.map((instruction) => {
        return(
            <li key={instruction.id}>{instruction.number}. {instruction.step}</li>
        )
    })
    return(
        <div className="recipe">
            {recipeList}
            <ul className="ingredients">
            {ingredientList}
            </ul>
            <br/>
            <h2>Instructions</h2>
            <ul className="instructions">
            {instructions}
            </ul>
        </div>
    )
}

export default BreakfastRecipe
